      </p>
      <p>
        <strong>Email:</strong> {currentUser.email}
      </p>
      <strong>user:  </strong>

        <div className="navbar-nav ml-auto">
        <li className="nav-item">
          <Link to={"/login"} className="nav-link">
            Login
          </Link>
        </li>

      </div>


    </div>

    </>

  );
  }

};

export default Profile;
